<!doctype html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=1024, user-scalable=no">
    <title>JinjaFx Logs</title>
    <link rel="shortcut icon" href="/874f2915/jinjafx.png">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/5.3.8/css/bootstrap.min.css" integrity="sha512-2bBQCjcnw658Lho4nlXJcc6WkV/UxpE/sAokbXPxQNGqmNdQrWqtw26Ns9kFF/yG792pKR1Sx8/Y1Lf1XN4GKA==" crossorigin="anonymous" referrerpolicy="no-referrer">
    <link rel="stylesheet" href="/ea73c0c8/jinjafx.css">
    <link rel="stylesheet" href="/de7e1d2d/jinjafx_logs.css">
  </head>
  <body>
    <div id="password_input" class="modal fade" data-bs-backdrop="static" tabindex="-1">
      <div class="modal-dialog modal-dialog-centered">
        <div class="modal-content">
          <div class="modal-header">
            <h4 class="mt-0">JinjaFx Logs</h4>
          </div>
          <div class="form-group row modal-body">
            <label id="lb_password" for="in_password" class="col-sm-12 col-form-label">Enter Password</label>
            <div class="col-sm-12">
              <input type="password" class="form-control" id="in_password">
            </div>
          </div>
          <div class="modal-footer">
            <button id="ml-password-ok" type="button" class="btn btn-primary">OK</button>
          </div>
        </div>
      </div>
    </div>
    <div class="container-fluid p-2">
      <pre></pre>
    </div>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/5.3.8/js/bootstrap.bundle.min.js" integrity="sha512-HvOjJrdwNpDbkGJIG2ZNqDlVqMo77qbs4Me4cah0HoDrfhrbA+8SBlZn1KrvAQw7cILLPFJvdwIgphzQmMm+Pw==" crossorigin="anonymous" referrerpolicy="no-referrer"></script>
    <script src="/73e9ceaf/jinjafx_logs.js"></script>
  </body>
